const logo = '../asserts/globalnav_apple_image__b5er5ngrzxqq_large.svg'


const srcNav = [
    logo,
    2,
    3, 
    4
]

function Nav(){
    const ListeNav = srcNav.map((element) => 

    <li key={element.toString()}><img src={element}></img></li>
    )
    return (
        <ul className="nav">{ListeNav}</ul>
    )
}

export default Nav
